import React from 'react'
import { Link } from 'react-router-dom'
import { LockOutlined, UserOutlined } from '@ant-design/icons'
import { useSelector, useDispatch } from 'react-redux'
import { Form, Input, message } from 'antd'
import { Formik } from 'formik'
import { validateForm } from '../../utils'

import { fetchRegister } from '../../redux/slices/Auth'
import { Button } from '../../components'
import './Register.scss'

const Register = props => {
    const dispath = useDispatch()
    const { regitserError } = useSelector(state => state.auth)

    const {
        values,
        touched,
        errors,
        handleChange,
        handleBlur,
        handleSubmit,
    } = props

    return (
        <div className='register'>
            <h1>Регистрация</h1>
            <Formik
                initialValues={{
                    name: '',
                    surname: '',
                    login: '',
                    password: '',
                    confirmation: '',
                }}
                validate={values => {
                    let errors = {}
                    validateForm({ values, errors })

                    return errors
                }}
                onSubmit={async (values, { setSubmitting }) => {
                    const { confirmation, ...data } = values
                    await dispath(fetchRegister(data))
                    if (regitserError) {
                        message.error(regitserError.message)
                    } else {
                        
                    }
                }}
            >
                {({ isSubmitting }) => (
                    <Form
                        name="normal_login"
                        className="login-form"
                        initialValues={{ remember: true }}
                        onFinish={handleSubmit}
                    >
                        <Form name="horizontal_login" layout="inline" style={{ justifyContent: 'space-between', marginBottom: 20 }}>
                            <Form.Item
                                style={{ width: '48%', margin: 0 }}
                                name="Name"
                                validateStatus={!touched.name ? '' : errors.name ? 'error' : 'success'}
                                rules={[{ required: true }]}
                            >
                                <Input
                                    id='name'
                                    prefix={<UserOutlined className="site-form-item-icon" />}
                                    placeholder="Имя"
                                    value={values.firstname}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                            </Form.Item>
                            <Form.Item
                                style={{ width: '48%', margin: 0 }}
                                validateStatus={!touched.surname ? '' : errors.surname ? 'error' : 'success'}
                                name="Surname"
                                rules={[{ required: true }]}
                            >
                                <Input
                                    id='surname'
                                    prefix={<UserOutlined className="site-form-item-icon" />}
                                    placeholder="Фамилия"
                                    value={values.suranem}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                            </Form.Item>
                        </Form>
                        <Form.Item
                            name="Login"
                            help={touched.login && errors.login && errors.login}
                            validateStatus={!touched.login ? '' : errors.login ? 'error' : 'success'}
                            rules={[{ required: true }]}
                        >
                            <Input
                                id='login'
                                prefix={<UserOutlined className="site-form-item-icon" />}
                                placeholder="Придумайте логин"
                                value={values.login}
                                onChange={handleChange}
                                onBlur={handleBlur}
                            />
                        </Form.Item>
                        <Form.Item
                            name="Password"
                            help={touched.password && errors.password && errors.password}
                            validateStatus={!touched.password ? '' : errors.password ? 'error' : 'success'}
                            rules={[{ required: true }]}
                        >
                            <Input.Password
                                id='password'
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                type="password"
                                placeholder="Пароль"
                                value={values.password}
                                onChange={handleChange}
                                onBlur={handleBlur}
                            />
                        </Form.Item>
                        <Form.Item
                            name="Confirmation"
                            help={touched.confirmation && errors.confirmation && errors.confirmation}
                            validateStatus={!touched.confirmation ? '' : errors.confirmation ? 'error' : 'success'}
                            rules={[{ required: true }]}
                        >
                            <Input.Password
                                id='confirmation'
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                placeholder="Поддтвердите пароль"
                                value={values.confirmation}
                                onChange={handleChange}
                                onBlur={handleBlur}
                            />
                        </Form.Item>
                        <Form.Item>
                            <Button content='Зарегестрироваться' padding={10} borderRadius={10} />
                        </Form.Item>
                    </Form>
                )}
            </Formik>
            <Link to='/auth/login'>Авторизоваться</Link>
        </div>
    )
}

export default withFormik({
    mapPropsToValues: () => ({
        name: '',
        surname: '',
        login: '',
        password: '',
        confirmation: '',
    }),
    validate: values => {
        let errors = {}
        validateForm({ values, errors })

        return errors
    },
    handleSubmit: (values, { setSubmitting }) => {
        onSubmit()
    },
    displayName: "RegisterForm"
})(Register)
